import React from 'react'
import { Grid } from 'semantic-ui-react';

const Audiocard = ({audiocard}) => {
    return (
        <Grid.Column>
            <Image src={audiocard.image} /> 
        </Grid.Column>

    )
}

export default Audiocard;
